class Solution:
    # 有向图需要构建邻接表 + 效率较低的DFS（优化手段实际上可以看成 n叉树， 根节点是较穷的一方，子节点是较为富有的一方）
    def loudAndRich(self, richer, quiet):
        n = len(quiet)
        # 构建邻接表
        adj = [set([i]) for i in  range(n)]
        poor = [set() for i in range(n)]

        # 深层次递归 将比 less 小的 j 的所有 大于j 的记录再加一个 more
        def dfs(less, more):
            for j in poor[less]:
                if more not in adj[j]:
                    adj[j].add(more)
                    dfs(j, more)
            
            for j in adj[more]:
                if j not in adj[less]:
                    adj[less].add(j)
                    dfs(less, j)

        for more, less in richer:
            adj[less].add(more)
            poor[more].add(less)
            dfs(less, more)

        ans = []
        for i in range(n):
            ans.append(min(adj[i], key=lambda x: quiet[x]))
        
        return ans

    # 抽线成树的 DFS 遍历
    def loudAndRich(self, richer, quiet):
        n = len(quiet)
        # 构建邻接表
        adj = [[] for i in  range(n)]
        for more, less in richer:
            adj[less].append(more)

        
        from functools import lru_cache
        @lru_cache(None)

        # 递归函数的定义： 返回 不比 i 穷困的，并且最安静的人
        def dfs(i):
            most_q = i
            for j in adj[i]:
                most_q = min([most_q, dfs(j)], key=lambda x: quiet[x])
            return most_q

        return list(map(dfs, range(n)))

